// Represents the current state of a timelock operation in its lifecycle.
//
// Operations move through these states sequentially as they are prepared,
// scheduled, and eventually executed.
type OperationState binary.BorshEnum

const (
	OperationState_Initialized OperationState = iota
	OperationState_Finalized
	OperationState_Scheduled
	OperationState_Done
)

func (value OperationState) String() string {
	switch value {
	case OperationState_Initialized:
		return "Initialized"
	case OperationState_Finalized:
		return "Finalized"
	case OperationState_Scheduled:
		return "Scheduled"
	case OperationState_Done:
		return "Done"
	default:
		return ""
	}
}

